import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './SalaryTable.css';

const SalaryTable = ({ contractId, month, year }) => {
  const [salaries, setSalaries] = useState([]);

  useEffect(() => {
    const fetchSalaries = async () => {
      try {
        const response = await axios.get(`http://localhost:5000/api/contracts/${contractId}/attendance`, {
          params: { month, year },
        });
        setSalaries(response.data);
      } catch (error) {
        console.error('Error fetching salaries:', error);
      }
    };

    fetchSalaries();
  }, [contractId, month, year]);

  const calculateEmployeeEPF = (grossSalary) => {
    return grossSalary > 15000 ? 15000 * 0.12 : grossSalary * 0.12;
  };

  const calculateEmployeeESIC = (grossSalary) => {
    return grossSalary > 21000 ? 21000 * 0.0075 : grossSalary * 0.0075;
  };

  const calculatePTax = (grossSalary) => {
    if (grossSalary > 20000) return 200;
    if (grossSalary > 15000) return 150;
    return 0;
  };

  const calculateEmployerEPF = (grossSalary) => {
    return grossSalary > 15000 ? 15000 * 0.12 : grossSalary * 0.12;
  };

  const calculateContribution = (basicSalary) => {
    let contribution = basicSalary * 0.005;
    if (contribution > 75) contribution = 75;
    return contribution;
  };

  const calculateAdminCharges = (pfWage) => {
    let charges = pfWage * 0.005;
    if (charges < 75) charges = 75;
    return charges;
  };

  const calculateEmployerESIC = (grossSalary) => {
    return grossSalary > 21000 ? 21000 * 0.0325 : grossSalary * 0.0325;
  };

  return (
    <div className="salary-table">
      <h2>Salary Details</h2>
      <table>
        <thead>
          <tr>
            <th>Employee Name</th>
            <th>Attendance</th>
            <th>Daily Wage</th>
            <th>Gross Salary</th>
            <th>Employee EPF (12%)</th>
            <th>Employee ESIC (0.75%)</th>
            <th>P Tax</th>
            <th>Total Deductions</th>
            <th>Net Salary</th>
            <th>Employer EPF (12%)</th>
            <th>Employer Contribution (0.5%)</th>
            <th>Admin Charges (0.5%)</th>
            <th>Employer ESIC (3.25%)</th>
          </tr>
        </thead>
        <tbody>
          {salaries.map((salary, index) => {
            const employeeEPF = calculateEmployeeEPF(salary.grossSalary);
            const employeeESIC = calculateEmployeeESIC(salary.grossSalary);
            const pTax = calculatePTax(salary.grossSalary);
            const totalDeductions = employeeEPF + employeeESIC + pTax;
            const netSalary = salary.grossSalary - totalDeductions;
            const employerEPF = calculateEmployerEPF(salary.grossSalary);
            const employerContribution = calculateContribution(salary.grossSalary);
            const adminCharges = calculateAdminCharges(salary.grossSalary);
            const employerESIC = calculateEmployerESIC(salary.grossSalary);

            return (
              <tr key={index}>
                <td>{salary.employeeName}</td>
                <td>{salary.attendance}</td>
                <td>{salary.dailyWage}</td>
                <td>{salary.grossSalary}</td>
                <td>{employeeEPF.toFixed(2)}</td>
                <td>{employeeESIC.toFixed(2)}</td>
                <td>{pTax.toFixed(2)}</td>
                <td>{totalDeductions.toFixed(2)}</td>
                <td>{netSalary.toFixed(2)}</td>
                <td>{employerEPF.toFixed(2)}</td>
                <td>{employerContribution.toFixed(2)}</td>
                <td>{adminCharges.toFixed(2)}</td>
                <td>{employerESIC.toFixed(2)}</td>
              </tr>
            );
          })}
          <tr className="total-row">
            <td>Total</td>
            <td>{salaries.reduce((sum, sal) => sum + sal.attendance, 0)}</td>
            <td>{salaries.reduce((sum, sal) => sum + sal.dailyWage, 0)}</td>
            <td>{salaries.reduce((sum, sal) => sum + sal.grossSalary, 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateEmployeeEPF(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateEmployeeESIC(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculatePTax(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateEmployeeEPF(sal.grossSalary) + calculateEmployeeESIC(sal.grossSalary) + calculatePTax(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + sal.grossSalary - (calculateEmployeeEPF(sal.grossSalary) + calculateEmployeeESIC(sal.grossSalary) + calculatePTax(sal.grossSalary)), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateEmployerEPF(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateContribution(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateAdminCharges(sal.grossSalary), 0).toFixed(2)}</td>
            <td>{salaries.reduce((sum, sal) => sum + calculateEmployerESIC(sal.grossSalary), 0).toFixed(2)}</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default SalaryTable;
